from typing import List, Any


def filter_integers(values: List[Any]) -> List[int]:
    """ Filter given list of any python values only for integers
    >>> filter_integers(['a', 3.14, 5])
    [5]
    >>> filter_integers([1, 2, 3, 'abc', {}, []])
    [1, 2, 3]
    """
    if isinstance(values, List[int]):
        return values
    if len(values) == 1:
        return values[0]
    return filter(lambda x: x!= 0, values)

from typing import List, Any


def filter_integers(values: List[Any]) -> List[int]:
    """ Filter given list of any python values only for integers
    >>> filter_integers(['a', 3.14, 5])
    [5]
    >>> filter_integers([1, 2, 3, 'abc', {}, []])
    [1, 2, 3]
    """
    if not isinstance(values, List[Any]):
        raise TypeError('values must be a list of any python values')
    if len(values) == 0:
        return []
    return filter(lambda x: x is not None, values)

